import React, { useState } from "react";
import "./Home.css";
import SimpleImageSlider from "react-simple-image-slider";
import HR3 from "./images/HR-3.jpg";
import HR1 from "./images/HR-1.jpg";
import leadership from "./images/leadership.jpg";

function Home() {

    const sliderImages = [
        {
            url: HR3,
        },
        {
            url: HR1,
        },
        {
            url: leadership,
        },
    ];

    return (
        <div>
            <div>
                <SimpleImageSlider
                    width={0}
                    height={0}
                    images={sliderImages}
                    showNavs={true}
                />
            </div>
        </div>
    );
}


export default Home;
